			<div className="indexCard">
				<div className="mainPageBtns">
				 <LogIn />
				 <SignIn />
				 <AboutUS />
				 </div>	
		    </div>
			
		</div>
		</ImageBackground>
		
		
		
	);
}

export default MainPage;
